import axios from "axios";
import { useEffect, useState } from "react";

const EmpList = () => {

    const [empData, setEmpData] = useState('');

    // useEffect(() => {
    //     console.log('asdf');
    // }, []);

    useEffect(() => {
        console.log('usEffect');
        axios.get('http://localhost:9090/emp/get-all-emps')
            .then((resp) => {
                console.log(resp)
                setEmpData(resp.data)
            })
    }, []);

    return (
        <>
            <div>
                <h1>Employee List</h1>
                <table border={1}>
                <thead>
                    <th>id</th><th>Name</th> <th>salayr</th> <th>aadhar</th>
                </thead>
                <tbody>
                {empData && empData.map(emp => (
                        <tr key={emp.employeeId}>
                            <th>{emp.firstName}</th>
                            <th>{emp.salary}</th>
                            <th>{emp.aadhar}</th>
                        </tr>
                    ))}
                </tbody>
                    
                </table>
            </div>
        </>
    );
}

export default EmpList;
